package org.tyaa.training.current.server.seeders;

import org.springframework.beans.factory.annotation.Value;
import org.springframework.core.annotation.Order;
import org.springframework.stereotype.Component;
import org.tyaa.training.current.server.entities.UserProfileEntity;
import org.tyaa.training.current.server.repositories.LanguageLevelRepository;
import org.tyaa.training.current.server.repositories.UserProfileRepository;
import org.tyaa.training.current.server.repositories.UserRepository;
import org.tyaa.training.current.server.seeders.interfaces.ISeeder;

import java.util.LinkedHashMap;
import java.util.Map;

@Component
@Order(value=6)
public class ProfileSeeder implements ISeeder {

    private final UserRepository userRepository;

    // private final UserProfileRepository profileRepository;

    private final LanguageLevelRepository languageLevelRepository;

    // @Value("#{${custom.init-data.profile-avatars}}")
    private Map<String, String> avatars = new LinkedHashMap<>();

    public ProfileSeeder(UserRepository userRepository/*, UserProfileRepository profileRepository*/, LanguageLevelRepository languageLevelRepository) {
        this.userRepository = userRepository;
        // this.profileRepository = profileRepository;
        this.languageLevelRepository = languageLevelRepository;
        avatars.put("admin", "");
        avatars.put("one", "");
        avatars.put("two", "");
        avatars.put("three", "");
    }

    @Override
    public void seed() {
        // для каждого демонстрационного пользователя
        userRepository.findAll().forEach(userEntity -> {
            // создать и установить профиль
            userEntity.setProfile(
                    UserProfileEntity.builder()
                            .name(userEntity.getName())
                            .avatar(avatars.get(userEntity.getName()))
                            .languageLevel(languageLevelRepository.findAll().get(0))
                            .build()
            );
            // сохранить объект сущности пользователя,
            // чтобы в БД выполнилась вставка записи профиля в таблицу профилей,
            // и в запись пользователя в таблице пользователей вставился идентификатор только что созданной записи профиля
            userRepository.save(userEntity);
        });
    }
}
